   <div id={this.props.id} style={{ fontSize: '14px',color:'black', marginLeft:'30px', marginBottom: '15px', marginTop: '12px' }}>{this.props.rating}</div>
 </div>
 <div id={this.props.id} className='col-sm-3'>
